import React from 'react';
import Emicalculator from './Emicalculator';
import '../../src/Style/personal_loan.css'

const PersoanlLoan = ()=>{
    
    return(  
        <div>
            
            <div class="personal-loan-promo">
                <h1>Get pre approved personal loan!</h1>
                
                <p>Bank's online personal loan EMI calculator makes it easy for you to figure out the monthly instalments on your loan. </p>

                <p>When you take a loan, the equated monthly instalment is a key factor in deciding the loan amount and tenure.
                    The personal loan calculator helps you instantly calculate your pay-outs and, therefore, plan your loan and repayment better. </p>

                 <p> To calculate your EMI, just enter the loan amount, rate of interest and loan tenure, and your EMI is instantly displayed. You can enter loan amounts from 50,000 to 4,000,000 and term from 1 to 5 years.
                     If you wish to change the EMI adjust any of the three sliders on the personal loan EMI calculator. If you wish to lower your EMI, you can do so by reducing the loan amount or the interest rate or by increasing the tenure. 
                     If you can afford higher monthly payments, you could consider increasing the loan amount or reducing your tenure.   </p>
                
            </div>
            <div class="personal-loan-calculate">
                <Emicalculator />     
            </div>
            

        </div>
    );

};

export default PersoanlLoan;
